import React, {Component} from 'react';
import raTeam from './raTeam.json';

import './../../css/RA-1.css'


export default class TeamList extends Component {

    constructor(props) {
        super();
        this.state = {
            teamName : props.teamName,
            teamMembers :[]
        }
    }


    something = (res) => {
        this.setState({teamName : "wtf bro"});
        this.setState({teamMembers : [res]});
        // console.log(this.state);
    }


    componentDidMount() {
        if(this.props.teamName === "RA") {
            let res = [raTeam.members];
            console.log(res);
            this.setState({teamMembers : res})

        }


    }



    render() {

        return(
            <div>
                <h1 id="text-danger">{this.state.teamName}</h1>

                <div className="container-fluid row">
                    {
                        this.state.teamMembers.map(member => {

                            <div className="profile col-lg-3 col-md-4 col-sm-6 col-8">
                                <h1>{member.name}</h1>
                                <img src={member.img} alt={member.name} id="harrison" />
                                <a className="link-text"  onClick={this.something}>
                                    <h3 id="meetH">Meet Harrison</h3>
                                </a>
                            </div>
                        })
                    }

            		<div className="profile col-lg-3 col-md-4 col-sm-6 col-8">
                        <h1>harrison</h1>
		                <img src="/images/harrison-newman-profile-pic.jpg" alt="harrison-newman-profile-pic" id="harrison" />
		                <a className="link-text"  onClick={this.something}>
                            <h3 id="meetH">Meet Harrison</h3>
                        </a>
		            </div>
		            <div className="profile col-lg-3 col-md-4 col-sm-6 col-8">
		                <h1>David Walker</h1>
		                <img src="/images/david-walker-profile-pic.jpg" alt="david-walker-profile-pic" />
		                <a className="link-text"  href="/david_walker"><h3>Meet David</h3></a>
		            </div>
		            <div className=" profile col-lg-3 col-md-4 col-sm-6 col-8">
		                <h1>Emily Clubb</h1>
		                <img className="long-photo" src="/images/emily-profile.jpeg" alt="emily-clubb-profile"/>
		                <a  href="/emily_clubb"><h3>Meet Emily</h3></a>
		            </div>
		        </div>

            </div>
        ); 
    }
}
